// Navbar.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import '../Style/Tapbar.css';
import homeIcon from '../Images/LOGO2.png'; // Votre icône pour la page d'accueil
import tournamentIcon from '../Images/LOGO2.png'; // Votre icône pour la page tournoi
import statsIcon from '../Images/LOGO2.png'; // Votre icône pour la page statistiques

function Navbar() {
  return (
    <div className="navbar">
      <div className="navbar-item">
        <NavLink to="/connexion" exact activeClassName="active">
          <img src={homeIcon} alt="Accueil" className="navbar-icon" />
          <div>Accueil</div>
        </NavLink>
      </div>
      <div className="navbar-item">
        <NavLink to="/tournoi" activeClassName="active">
          <img src={tournamentIcon} alt="Tournoi" className="navbar-icon" />
          <div>Tournoi</div>
        </NavLink>
      </div>
      <div className="navbar-item">
        <NavLink to="/messtatistiques" activeClassName="active">
          <img src={statsIcon} alt="Statistiques" className="navbar-icon" />
          <div>Mes Statistiques</div>
        </NavLink>
      </div>
    </div>
  );
}

export default Navbar;
